import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Internships from './Internships/Internships';

function App() {
  return (
    <div className="container">
      <BrowserRouter>
        <Routes>
          <Route exact path="/home" element={<Internships/>}></Route>                
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
